import React, { useState, useEffect } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

const CurrencyChatBot = () => {
  const [amount, setAmount] = useState("");
  const [exchangeRates, setExchangeRates] = useState({});
  const [historicalRate, setHistoricalRate] = useState(null);
  const [selectedDate, setSelectedDate] = useState(null);

  useEffect(() => {
    // Fetch current exchange rates for USD, EUR, BTC
    fetch(
      "https://api.coingecko.com/api/v3/simple/price?ids=usd,bitcoin,euro&vs_currencies=usd"
    )
      .then((response) => response.json())
      .then((data) => {
        if (data && data.usd && data.bitcoin && data.euro) {
          /* eslint-disable */console.log(...oo_oo(`1668484363_19_10_19_31_4`,response));
          setExchangeRates({
            USD: data.usd,
            BTC: data.bitcoin,
            EUR: data.euro,
          });
        } else {
          /* eslint-disable */console.error(...oo_tx(`1668484363_26_10_26_56_11`,"Error fetching exchange rates"));
        }
      })
      .catch((error) => {
        /* eslint-disable */console.error(...oo_tx(`1668484363_30_8_30_67_11`,"Error fetching data from CoinGecko:", error));
      });
  }, []);

  const formatNumber = (num) => {
    return num.replace(/\B(?=(\d{3})+(?!\d))/g, ".");
  };

  const handleChange = (e) => {
    let value = e.target.value.replace(/\./g, "");
    if (value === "") {
      setAmount("");
    } else if (!isNaN(value)) {
      value = parseInt(value).toString();
      setAmount(formatNumber(value));
    }
  };

  const calculateAmount = (value, rate) => {
    const numericValue = value ? parseInt(value.replace(/\./g, "")) : 0;
    if (numericValue === 0) return rate ? formatNumber(rate.toFixed(0)) : "0";
    return (numericValue * rate)
      .toFixed(0)
      .replace(/\B(?=(\d{3})+(?!\d))/g, ".");
  };

  const handleDateChange = (date) => {
    setSelectedDate(date);

    if (date) {
      const formattedDate = date.toISOString().split("T")[0];
      // Fetch historical rate for USD to ARS on selected date
      fetch(
        `https://api.coingecko.com/api/v3/coins/usd/history?date=${formattedDate}`
      )
        .then((response) => response.json())
        .then((data) => {
          if (data && data.market_data && data.market_data.current_price) {
            setHistoricalRate({
              USD: data.market_data.current_price.ars,
            });
          } else {
            setHistoricalRate(null);
          }
        })
        .catch((error) => {
          /* eslint-disable */console.error(...oo_tx(`1668484363_76_10_76_65_11`,"Error fetching historical data:", error));
        });
    } else {
      setHistoricalRate(null); // Clear historical rate if date is cleared
    }
  };

  return (
    <div>
      <h2>Currency Converter</h2>
      <input
        type="text"
        value={amount}
        onChange={handleChange}
        placeholder="Enter Amount"
      />
      <br />
      <br />
      <p>USD to ARS: {calculateAmount(amount, exchangeRates.USD)} ARS</p>
      <p>BTC to ARS: {calculateAmount(amount, exchangeRates.BTC)} ARS</p>
      <p>EUR to ARS: {calculateAmount(amount, exchangeRates.EUR)} ARS</p>

      <h3>Select Date for Historical Rate</h3>
      <DatePicker
        selected={selectedDate}
        onChange={handleDateChange}
        dateFormat="yyyy-MM-dd"
        maxDate={new Date()}
        placeholderText="Select a date"
      />

      {historicalRate && (
        <div>
          <h4>
            Historical Exchange Rate on{" "}
            {selectedDate.toISOString().split("T")[0]}
          </h4>
          <p>USD to ARS: {formatNumber(historicalRate.USD.toFixed(0))} ARS</p>
        </div>
      )}
    </div>
  );
};

